import React from 'react'
import { useSelector } from 'react-redux';

export default function Q3() {
    let afichage=useSelector((data)=>data.table.continents)
  return (
    <div>
      {afichage.length>0?afichage.map((rsl)=>{
         return <ul>
           <li>{rsl.avatar}</li>
        <li>{rsl.name}</li>
        <li>{rsl.surfaceArea}</li>
       
      </ul>
          
      
      }):'vide'}
       
    </div>
  )
}
